import React from 'react'


class Edit extends React.Component{

    render(){
        return (
            <form className="ui large form">
            <label>Username</label>
            <input type="text" name="username" />
            <label>First Name</label>
            <input type="text" name="first_name" />
            <label>First Name</label>
            <input type="text" name="first_name" />

            </form>
        )
    }
}


export default Edit
